import React, { useState } from 'react';
import { Container } from 'react-bootstrap';
import './emojijeweled.scss';
import '../../../../css/mediaqueries.scss';

const COLS = 10;
const ROWS = 10;

const EMOTES = ["🍳", "🍞", "🍣", "🧁", "☕", "🥕", "🍑", "🍇"]

export default function Emojijeweled() {

    let [grid, setGrid] = useState(new Array(ROWS).fill(0).map((v, i) => new Array(COLS).fill(0).map((v, i) => EMOTES[Math.floor(Math.random() * EMOTES.length)])));


    return (
        <Container className="media-width container">
            
            <Container fluid></Container>
        </Container>
    );
}
